        <Card style={{ width: '18rem' }}>
          <Card.Img variant="top" src="image.jpg" />
          <Card.Body>
            <Card.Title> {props} </Card.Title>
            <Card.Text>
            </Card.Text>
            <Button variant="primary">Go somewhere</Button>
          </Card.Body>
        </Card>
      );
}


export default cartDetails
